INSERT INTO `equipments` (`equipId`, `equipName`, `equipDesc`, `manufacId`, `equipEngineNumber`, `equipPrice`, `categoryId`, `equipStatus`, `equipimage`) VALUES
(1, 'Wheel Loader, 3.0 - 3.4 Cubic Yard', 'Wheel Loader, 3.0 - 3.4 Cubic Yard\nArticulated Wheel Loader, Front End Loader, Bucket Loader\n4 Wheel Drive unit\nForward and rear work lights\nUser-friendly controls\nUp to 3.4 cubic yard capacities', 1, '', '10000.00', 1, 'Available', ),
(2, 'Wheel Loader, 2.0 - 2.4 Cubic Yard', 'We have selected these machines to give you maximum productivity with minimum operator fatigue. High visibility, all-weather cabs are roomy and quiet for operator comfort. Automatic transmissions and hydraulic power steering give you smooth, responsive operation with user-friendly control. Turbo-charged diesel engines let you get trucks loaded or trenches filled more efficiently and with fewer cycle times while meeting off-road emission requirements. Forward and rear work lights are standard. Please note that the information below is affected by optional tire size, ballast, and attachments..\n4 Wheel Drive unit\nForward and rear work lights\nUser-friendly controls', 1, '', '9000.00', 1, 'Available', ),
(3, 'Backhoe Loader 60 hp', 'Digging depth up to 14\'8\"\nLift capacity up to 6803 lbs\nTravel speed up to 24.6 mph', 1, '', '1.00', 2, 'Available', ),
(4, 'Carry Deck Crane, 8.5-9 Ton', 'Whether you are installing signs, rooftop air conditioners, building trusses, or lifting material to the next level of your building project, United Rentals has a mobile truck crane to fit your needs. Do you have several projects going at once? Don’t rent one crane for each project, just rent one highway legal truck crane and use it at all of your sites. Call for specific load and angle information.\nFully hydraulic controls for smooth, precise operation\nTight turning radius provides great jobsite maneuverability\nEasy to operate\n', 1, '', '1.00', 5, 'Available', ),
(5, 'Carry Deck Crane, 15 Ton', 'Versatility and utility are yours with Broderson carry deck cranes. United Rentals chose these industrial cranes because they are the toughest in the business. The carry deck area allows you to transport ‘bonus’ loads and eliminates the necessity of traveling with a dangerous, free swinging load out on the hook. Tight spaces are not a problem with the low profile IC20 and IC35; their widths are 4\' and 5’. Both cranes have a 90º boom rotation and a 20 sq. ft. cargo deck. Rough terrain cranes from 18- to 35-ton capacity are also available. The width of the IC80 is 6\' 6\" and the width of the IC200 is 8\'; both feature continuous boom rotation and larger load capacities.\nFully hydraulic controls for smooth, precise operation\nTight turning radius provides great jobsite maneuverability\nEasy to operate', 1, '', '1.00', 5, 'Available', );
INSERT INTO `equipments` (`equipId`, `equipName`, `equipDesc`, `manufacId`, `equipEngineNumber`, `equipPrice`, `categoryId`, `equipStatus`, `equipimage`) VALUES
(6, 'Dozer, 70hp', 'Our 500 to 5000 ft.-lb. hammers are ideally suited for road repair, concrete demolition and site preparation. 3000-5000 ft.-lb. hammers are suited for bridge-work, rock miningfoundation removal, and other major demolition tasks. Dust intake prevention systems improve the life of the piston, working steel and bushing. Adjustable stroke lengths varies the impact energy per blow, allowing the operator to match the carrier to the work at hand. FRD/Kent offers multiple attachment configurations to make it fast and easy for use on mini-excavators, skid steer loaders or backhoes.\n\nStandard, Wide and LGP (Low Ground Pressure) Track models available\nSuperior, unrestricted visibility of the blade\nAutomatic parking brake for enhanced safety\n', 1, '', '1.00', 3, 'Available', ),
(7, 'Dozer, 110hp', 'Dozers are constructed with a comfortable and quiet work environment in mind. Our dozers are easy to operate with exceptional control and maneuverability. Various speed settings in each model to fit your job’s needs. The hydrostatic “PowerStat” drivetrain delivers individual power to each track.The “high-performance blade hydraulics” delivers ideal control and breakout force. You cannot go wrong with any of the models offered by United Rentals. Contact a qualified customer support representative today (800-UR-Rents) to match your jobs needs to one of the models offered below.\nStandard, Wide and LGP (Low Ground Pressure) Track models available\nSuperior, unrestricted visibility of the blade\nAutomatic parking brake for enhanced safety\n', 1, '', '1.00', 3, 'Rented', ),
(8, 'Excavator, 25,000-29,000 lbs', 'United Rentals features John Deere excavators with easy-to-use Powersize engine/hydraulic management that maximizes engine output and saves fuel by keeping a constant balance between pressure and flow.Deere excavators are easy to control in multiple function applications like precision grading. Just punch in the grading mode and smoothly boom-out while you begin to propel across the top of the embankment. Next keep propelling while you boom-up, arm-in, and curl the bucket. Cab features low noise, great visibility, heater, ventilation, AM/FM radio, and vibration cushioned seat. Bucket clamps, clearing rakes, ditching buckets, grapples, and hydraulic hammers are available. Excavators larger than 45,000 lbs. are also available from United Rentals Heavy Machinery Division and select General Rental locations.\nExcellent all-around visability\nComfortable, climate controlled operator cab\nEasy-to-use joystick controls\n', 1, '', '1.00', 7, 'Rented', );
INSERT INTO `equipments` (`equipId`, `equipName`, `equipDesc`, `manufacId`, `equipEngineNumber`, `equipPrice`, `categoryId`, `equipStatus`, `equipimage`) VALUES
(9, 'Mini Excavator, 7000-9999 lbs', 'The compact size and offset digging capability of United Rentals’ mini-excavators makes them well suited for close working conditions. Low weight permits use on jobsites with weight restrictions and for interior demolition. Multi-function hydraulics let you use several functions at the same time for fast cycle times and greater productivity. Independent boom swing permits offset digging around obstacles and beside structures. Straight travel feature lets you use any excavator function while traveling and maintain a straight course. Backfill blade allows the excavator to backfill a trench or grade a jobsite. The Takeuchi TB108 is retractable and can fit through most doorways and backyard gates. Buckets from 9\" to 36\" are available. Hydraulic breakers, augers, grapples, and thumbs are also available. These machines can be transported with a pickup truck and small trailer. Rubber tracks are standard.\nSafely transportable by pickup or trailer\nEasy-to-use joystick controls\nMulti-function hydraulics for fast cycle times and greater productivity\nBackfill blade doubles as a stabiliz', 1, '', '1.00', 7, 'Rented', ),
(10, 'Skid Steer Loader, 1700-1899 lbs', 'United Rentals offers you the world’s largest fleet of dependable skid-steer loaders. From the farm to the construction site to the industrial plant, these compact and maneuverable machines are ready to tackle your jobs fast and cost-effectively. Skid-steers are excellent for digging, grading and leveling. The larger machines are suited for the toughest applications and for use with special high-performance high-flow hydraulic attachments. A wide variety of attachments allow each of these machines to do more than just load materials. Quick-change attachment systems give you the ability to quickly and easily connect attachments.\r\nConvenient high/low speed control options\r\nQuick-change attachment system\r\nCompact, with great maneuverability', 1, '', '1.00', 4, 'Available', );

